import React from "react"

const Foodcard = ({ img, desc, heading, process, ingredients }) => {
  return (
    <div
      className="foodcard"
      style={{ backgroundImage: "url(" + { img } + ")" }}
    >
      }
      <h1>{heading}</h1>
      <h4>{ingredients}</h4>
      <p>{desc}</p>

      <ul>{process}</ul>
    </div>
  )
}
export default Foodcard
